import React from 'react'
import { Link } from "react-router-dom";
import { UseLogout } from '../hooks/useLogout';
import { UseUserContext } from '../hooks/useUserContext';

function Navbar() {
    const mystyle={
        backgroundColor:'#e3f2fd'
    }
    const {user} = UseUserContext()
    const { logout } =  UseLogout();
    const handleLogout = async (e) => {
      await logout();
      <Link to='/login'/>
}
  return (
    <div>
     <nav class="navbar" style={mystyle}>
  <div class="container-fluid">
    <a class="navbar-brand" href="/">iSpeedVol</a>
    <button class="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
      <span class="navbar-toggler-icon"></span>
    </button>
    <div class="collapse navbar-collapse" id="navbarSupportedContent">
      <ul class="navbar-nav me-auto mb-2 mb-lg-0">
        <li class="nav-item">
        <Link className='nav-link' to={"/login"} style={{ fontSize: '18px' }}>Login</Link>
     {user ? (<button className='logoutButton' onClick={() => handleLogout()}>Logout</button>) : null}
      </li>
      </ul>
    </div>
  </div>
</nav>
    </div>
  )
}

export default Navbar
